webpackJsonp([0xe0cf1b28ce69],{4828:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Happy Birthday Dad!",date:"10 Mar 2000",slug:"/2000-03-10-happy-birthday-dad/",tags:"Y2000"},html:'<p><img src="/images/mausnews/stmp.jpg" align="RIGHT" />I had heard about this, but just saw it today. The round postage stamp from the Deutsche Post. In fact, it\'s bimodal. You can either tear the straight lines for a square version, or punch out the circle for a round version.</p>'},next:{fields:{title:"Asleep on the Couch",date:"08 Mar 2000",slug:"/2000-03-08-asleep-on-the-couch/"}},previous:{fields:{title:"Hippo Day",date:"11 Mar 2000",slug:"/2000-03-11-hippo-day/"}}},{node:{fields:{title:"Asleep on the Couch",date:"08 Mar 2000",slug:"/2000-03-08-asleep-on-the-couch/",tags:"Y2000"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/03/20000307010.jpg" height="262" width="350" border="0" alt="crh0307.jpg: " /></p>\n<p>We\'re all to tired today to think of any entries. Maybe tomorrow!</p>'},next:{fields:{title:"Super Tuesday",date:"07 Mar 2000",slug:"/2000-03-07-super-tuesday/"}},previous:{fields:{title:"Happy Birthday Dad!",date:"10 Mar 2000",slug:"/2000-03-10-happy-birthday-dad/"}}},{node:{fields:{title:"Super Tuesday",date:"07 Mar 2000",slug:"/2000-03-07-super-tuesday/",tags:"Y2000"},html:'<p>I hope either McCain or Bradley stays in the race. I have to pay big bucks for postage to send in an absentee ballot, but Gore vs Bush is not worth the bother of licking the stamp.</p>\n<p>We had a tough weekend. Our neighbor Walter turned 70 on Saturday, with dinner and coffee starting at 11 am at the fire hall in LÃ¼llau. And the schnaps started flowing before noon. Then on Sunday we had a combined February birthday for me, Mama\'s brother and his 5-year-old daughter. Highlight was hearing her sing along to the new <a href="http://www.tomjones.com">Tom Jones</a> single: <a href="http://www.v2music.com/Scripts/WebObjects-ISAPI.dll/V2_New_Publisher.woa/74892000002661200000629520000025733/TomJonesReleaseIndex.wo/018020000006733/0.3.0/1/Webobjects1">Sex Bomb</a>!</p>\n<p>Christopher came through the weekend in much better shape than Mama and I!</p>'},next:{fields:{title:"Rosenmontag",date:"06 Mar 2000",slug:"/2000-03-06-rosenmontag/"}},previous:{fields:{title:"Asleep on the Couch",date:"08 Mar 2000",slug:"/2000-03-08-asleep-on-the-couch/"}}}],pathPrefix:"",first:!1,last:!1,index:1073,pageCount:1101}}}});
